import React from 'react';
import './headerStyles.scss'
import {Link} from 'react-router-dom';
import {ReactComponent as Logo} from "../../assets/crown.svg"

const Header = () => (
    <div className="header">
    <Link to="/">
    <Logo className='logo'/>
    </Link>
    </div>

);

export default Header
